import src.e2vdom

def on_compile(application, object, action_name, context, objects):
	result=objects
	for xobject in object.get_objects_list():
		result.append({"object": xobject})
	return result

class VDOM_dialog(VDOM_object):

	def render(self, parent, contents=""):

		id = 'o_' + (self.id).replace('-', '_')

		result  = ""

		if self.resizable == "0":
			minheight = self.minheight
			minwidth = self.minwidth
			resizable = "true"
			other = ""
#			result += '<link rel="stylesheet" href="/4c9582ae-30e3-4d9c-8227-57665ceb42ce.res" type="text/css" media="screen">'
		else:
			resizable = "true"
			minheight = self.height
			minwidth = self.width
#			result += """<style type="text/css">.ui-resizable-s, .ui-resizable-e, .ui-resizable-w, .ui-resizable-se, .ui-resizable-sw, .ui-resizable-nw, .ui-resizable-ne {cursor:default}</style>"""
			other = """,
			maxWidth:""" + self.width + """,
			maxHeight:""" + self.height + """
			"""
		if self.draggable == "0":
			draggable = "true"
		else: draggable = "false"

		if self.show == "1":
			show = "true"
		else: show = "false"

		if self.modal == "1":
			modal = "true"
			result += """<style type="text/css">.boxy-modal-blackout{background-color: #""" + self.modalcolor + """}</style>"""
		else: modal = "false"

#		result += "<div style='display:none' id='" + id + "'>" + contents + "</div>"
		result += "<table cellspacing='0' cellpadding='0' border='0' class='boxy-wrapper'><tr><td class='top-left'></td><td class='top'></td><td class='top-right'></td></tr><tr><td class='left'></td><td class='boxy-inner'><div id='" + id + "'>" + contents + "</div></td><td class='right'></td></tr><tr><td class='bottom-left'></td><td class='bottom'></td><td class='bottom-right'></td></tr></table>"

		result += """<script type='text/javascript'>
jQuery(document).ready(function($){
	$('#""" + id + """').css({position:'relative',width:""" + self.width + """,height:""" + self.height + """});
	dialog_win_""" + id + """=new Boxy($('#""" + id + """'),{
		width: """ + self.width +  """
		,height: """ + self.height +  """
		,draggable:""" + draggable + """
		,title: '""" + self.title + """'
		,show: """ + show +  """
		,modal: """ + modal +  """
		,closeText:''
		,afterHide: function(){ $('object[classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000"],object[type=application/x-shockwave-flash],embed[src$="swf"]').show(); }
		,afterShow: function(){ 
		}
	});
	if(typeof pngfix=='function'){
		$('.boxy-wrapper').find('.top,.left,.right,.bottom,.top-right,.top-left,.bottom-left, .bottom-right').pngfix({sizingMethod:'scale'});
	}
});
</script>"""

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):

		result="<container id=\"%s\" zindex=\"%s\" hierarchy=\"%s\" order=\"%s\" top=\"%s\" left=\"%s\" width=\"%s\" height=\"%s\">"\
					"<svg>"\
						"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"%s\" fill=\"#EEEEEE\" fill-opacity=\".4\" />"\
					"</svg>%s"\
				"</container>"%(
					self.id, self.zindex, self.hierarchy, self.order, self.top, self.left, self.width, self.height,
					0, 0, self.width, self.height,
					contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)
